  const [components, setcomponent] = useState([]);

  const getcomponent = () =>{
    fetch('https://norma.nomoreparties.space/api/ingredients ')
    .then(res => res.json())
    .then(data => setcomponents(data))
  }

  return (
    <div className={styles.app}>
      
      	<AppHeader/>
        <Main components={components}/>

      
    </div>
  );
}

export default App;
